    @include mixin.theme-aware("background", "brand-black");
    box-shadow: 0px 10px 15px -3px rgba(0, 0, 0, 0.1);
  }

  * {
    color: inherit !important;
  }

  span {
    font-size: inherit;
    font-weight: inherit;
    font-size: inherit;
    letter-spacing: inherit;
  }

